  result += y[27] * ums[27] * imw[27]; /*HCCO */
  result += y[28] * ums[28] * imw[28]; /*CH2CO */
  result += y[29] * ums[29] * imw[29]; /*HCCOH */
  result += y[30] * ums[30] * imw[30]; /*N2 */
